Titel:  Sleeping Beauty: Platinum Editon - 3e Editie 

Laat je meeslepen door de pracht van Sleeping Beauty, Walt Disney&amp;#039;s klassieke sprookje. Zie nu meer dan je ooit hebt gezien met de magische ultramoderne technologie; deze buitengewone film is gerestaureerd en nu nog briljanter dan het origineel. Beleef Sleeping Beauty precies zoals Walt zich het had voorgesteld: zuiver, prachtig en ongeloofl ijk adembenemend. Sleeping Beauty verandert je huis in een fantastische wereld, waar je gezin keer op keer van wil genieten!


